class : public Operation {
  bool match(
    Value *V, SmallVectorImpl<Match> &Matches) const override {
    
    Value *tmp0; Value *tmp1;
    bool Matched = hasBitWidth(V, 64) &&
PatternMatch::match(V, m_c_FAdd(
      m_Value(tmp0),
      m_Value(tmp1))) &&
hasBitWidth(tmp0, 64) &&
hasBitWidth(tmp1, 64);
    if (Matched)
      Matches.push_back({
      false,
      // matched live ins
      { tmp0, tmp1 },
      // the matched value itself
      V
      });
    return Matched;
    
  }
} Operation0;
  

